import time
a=time.time()
class Empty(Exception):
    pass
class LinkedStack:
    class _Node: #non public class for storing a singly linked node
        __slots__=['_element', '_next'] 
        def __init__(self,element,next):
            self._element=element # referencing the user's element
            self._next=next # referencing the user's next node
    def __init__(self): #initilasing an empty stack
        self._head=None  #referncing to the head node
        self._size=0 # #initilasing the size of stack to zero
    def __len__(self): #function to find length of stack
        return self._size #returns the size of the stacks which keeps on updating after push and pop
    def is_empty(self): #returns whether the stack is empty or not
        return self._size==0 #returns true if size of stack is zero else false
    def top(self): #returns top element of the stack
        if self.is_empty(): #raises error if the stack is empty
            raise Empty('Stack is Empty')
        return self._head._element #returns the head element 
    def push(self,e): #pushes the element e to the stack
        self._head = self._Node(e,self._head) # updates the head of the stack by creating another element storing value of e and next value as the intial head
        self._size+=1 #incrementing the size of stack
    def pop(self): #removes the top element from the stack
        if self.is_empty(): #raises error if the stack is empty
            raise Empty('Stack is Empty')
        answer=self._head._element #head element value stored before updating
        self._head=self._head._next #updating the head as the next element of head
        self._size-=1 #decreasing the size of stack
        return answer #rerurning the stored value of answer
    def __str__(self): #returns the stack in string format
        arr='' #initialising the array as an empty string
        start=self._head #starting with the head element
        for i in range(self._size):
            arr+=str(start._element)+', ' #adding the value of element at the variable start and , to the string 
            start=start._next #updating the start variable to the next element of the list
        return '<' +arr+']' #retuning the string with applying brackets 

def findPositionandDistance(P):
    x=0 # variable for updating the coordinates of x 
    y=0 # variable for updating the coordinates of y
    z=0 # variable for updating the coordinates of z
    d=0 # variable for updating the value of distance d 
    num=[] #list for storing the digits in the string to be used later for multiplying with the multiplier
    ans=[] #final output list
    multiplier=1 #variable for storing the number with which x/y/z must be added whenever there is +/- X/Y/Z in the input string depending on how many open brackets and multipliers are present before the +/ operation
    prev_mult=LinkedStack() #stack for storing the latest factor by which the multiplier was multplied so that the top element of stack can be used to again divide the multiplier when there is a ) in the string.

    for i in range(len(P)): #applying loop to access each element of the input string
        if P[i]=='+' or P[i]=='-' : #these operations are included whenever X/Y/Z is found in the string later so can skip them initially to reduce time complexity
            continue

        elif P[i]=='X':
            if P[i-1]=='+': #checking the operation preceding the variable and accordingly updating the coordinates of that variable
                x+=multiplier
                d+=multiplier
                continue
            else: #the other possibility will definitely be a - operation
                x-=multiplier
                d+=multiplier
                continue

        elif P[i]=='Y':
            if P[i-1]=='+': #checking the operation preceding the variable and accordingly updating the coordinates of that variable
                y+=multiplier
                d+=multiplier
                continue
            else: #the other possibility will definitely be a - operation
                y-=multiplier
                d+=multiplier
                continue
            
        elif P[i]=='Z':
            if P[i-1]=='+': #checking the operation preceding the variable and accordingly updating the coordinates of that variable
                z+=multiplier
                d+=multiplier
                continue
            else: #the other possibility will definitely be a - operation
                z-=multiplier
                d+=multiplier
                continue

        elif P[i].isdigit(): # whenever we find digits in the string then we keep on appending them in the num list until we find a '(' which means that the string of digits has ended
            num.append(P[i])
            continue
            # solve(s,num)
        elif P[i]=='(': # the ( means that the string of digits preceding it has ended hence we convert the num list into integer and update the multiplier by mutiplying with that integer so that opeartions inside the ( are performed with the suitable multiplier
            multiplier*=int(''.join(num)) 
            prev_mult.push(int(''.join(num))) #pushing the latest factor of multiplier in the prev_mult stack
            num=[] # again updating the num list to empty so that it can be used again later
            continue

        elif P[i]==')': 

            multiplier//=prev_mult.top() #whenever we find a ) then update the multiplier by dividing with it's latest factor it was multiplier earlier by using the top element of stack prev_mult
            prev_mult.pop() #removing the previous factor of multiplier so that next factor comes on top of stack to be used when we find the next ) for dividing the multiplier
            continue

    ans.append(x) #after all elements of the string are operated then we finally append the values of x,y,z,d to the final output list ans
    ans.append(y)
    ans.append(z)
    ans.append(d)
    return(ans) #returning ans
